body:
This pr is not for performance or new feature, it is just about coding style.

I did these adjustments for increasing the expandability of skywalking propagation mechanism. 

- Client side.
Put key:value pairs into **HTTP HEAD** by iterating Carrier items.
```java
            span = ContextManager.createExitSpan("/span/operation/name", contextCarrier, "ip:port");
            CarrierItem next = contextCarrier.items();
            while (next.hasNext()) {
                next = next.next();
                heads.put(next.getHeadKey(), next.getHeadValue());
            }
```

- Server side
Set value from the **HTTP HEAD** of the given keys of carrier items.
```java
            ContextCarrier contextCarrier = new ContextCarrier();
            CarrierItem next = contextCarrier.items();
            while (next.hasNext()) {
                next = next.next();
                next.setHeadValue(heads.get(next.getHeadKey()));
            }

            span = ContextManager.createEntrySpan(/span/operation/name, contextCarrier);
```
